    render(){
        return(
            <div>
                <div className='col-md-2'>
                    <DashBoardNavigator/>
                </div>
                <div className='col-md-8'> 
                    <DashBoardNavigator/>
                </div>
            </div>
        );
    }
}

export default  MainDashBoard;
